import React from 'react';
import Video from '../../videos/video.mp4';
import GradPhoto from '../../images/MyPhoto.JPG';
import AwardPhoto from '../../images/Award.png';
import EduPhoto from '../../images/Education.png'
import {
  HomeContainer,
  HomeBg,
  HomeVideoBg,
  HomeWrapper,
  Home,
  HomeLeft,
  HomePhotoCard,
  HomePhotoIcon,
  HomePhotoTitle,
  HomeResumeCard,
  HomeResumeCardIn,
  HomeDownloadIcon,
  HomeButtonD,
  HomeRight,
  HomeEduCard,
  HomeEduCardIn,
  HomeEduIcon,
  HomeEduAwardTitle,
  HomeEduAwardP,
  HomeAwardCard,
  HomeAwardCardIn,
  HomeAwardIcon  
} from './HomeElements';
import axios from 'axios';

function HomeSection() {

  var fileDownload = require('js-file-download');
  const handlePDFDownload = () => {
    axios.get('api/views.py', { 
      responseType: 'blob',
    }).then(res => {
      fileDownload(res.data, 'Isse_Nur_Resume.pdf');
      console.log(res);
    }).catch(err => {
      console.log(err);
    })
  }
  return (
    <HomeContainer id='home'>
      <HomeBg>
        <HomeVideoBg playsInline autoPlay loop muted src={Video} type='video/mp4' />
      </HomeBg>
      <HomeWrapper>
        <Home>
          <HomeLeft>
            <HomePhotoCard>
              <HomePhotoIcon src={GradPhoto}></HomePhotoIcon>
              <HomePhotoTitle>Isse H Nur</HomePhotoTitle>
            </HomePhotoCard>
            <HomeResumeCard>
              <HomeResumeCardIn>
               <HomeButtonD  onClick={() => handlePDFDownload()}> DOWNLOAD RESUME/CV<HomeDownloadIcon/></HomeButtonD>
              </HomeResumeCardIn> 
            </HomeResumeCard>
          </HomeLeft> 
          <HomeRight>
            <HomeEduCard>        
              <HomeEduCardIn>     
                <HomeEduIcon src={EduPhoto}></HomeEduIcon>
                <HomeEduAwardP>Degree: BS in Computer Science</HomeEduAwardP>
                <HomeEduAwardP>Graduation Date: December 15 2020</HomeEduAwardP>
              </HomeEduCardIn>
              <HomeEduAwardTitle>Education</HomeEduAwardTitle>
            </HomeEduCard>
            <HomeAwardCard>      
              <HomeAwardCardIn>
                <HomeAwardIcon src={AwardPhoto}></HomeAwardIcon>
                <HomeEduAwardP>Phi Theta Kappa Honors Society</HomeEduAwardP>
              </HomeAwardCardIn>
              <HomeEduAwardTitle>Awards</HomeEduAwardTitle>
            </HomeAwardCard>
          </HomeRight>
        </Home>
      </HomeWrapper>
    </HomeContainer>
  );
}

export default HomeSection;
